import PropTypes from 'prop-types'
import React from 'react'

const Button = ({color,text}) => {
    return ( 
    <button style={{backgroundColor:color}} className='btn'> {text}</button>

    )
}
Button.defaultProp={
    color:'blue'
}
Button.propTypes = {
    text: PropTypes.object.isRequired
  }


export default Button
